import Header from "../components/Header/Header"
import Footer from "../components//footer/Footer"
import Main from "../components/Main/Main"
import SmoothScroll from "./SmoothScroll"
import "../App.css"

const Home = () => {
  return (
    <>
      //{" "}
      <SmoothScroll>
        <Header />
        <Main />
        <Footer />
      </SmoothScroll>
    </>
  )
}

export default Home
